import { Component } from "react";
import AtomicHabit from "./images/BooksImg/atomicHabits.jpg";
import HungerGames from "./images/BooksImg/TheHungerGames.jpg";
import WorldWar from "./images/BooksImg/WorldWarZ.jpg";
import DieHard from "./images/BooksImg/DieHard.jpg";
import PlayerOne from "./images/BooksImg/TheReadyPlayerOne.jpg";
import { ScrollingCarousel } from "@trendyol-js/react-carousel";

export default class Books extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col">
        <h3 className="mx-1">Top Books</h3>
        <ScrollingCarousel className="m-1">
          <img src={AtomicHabit} style={{height: "400px", width: "200px"}} className="img-fluid rounded mx-2" alt="..." />
          <img src={HungerGames} className="img-fluid rounded mx-2" alt="..." />
          <img src={WorldWar} className="img-fluid rounded mx-2" alt="..." />
          <img src={DieHard} className="img-fluid rounded mx-2" alt="..." />
          <img src={PlayerOne} className="img-fluid rounded mx-2" alt="..." />
        </ScrollingCarousel>
          </div>
        </div>
      </div>
    );
  }
}
